import { motion } from "framer-motion";
import Head from "next/head";
import Layout from "../components/layout";

export default function MyComponent() {
  return (
    <div>
      <motion.div
        animate={{
          scale: [1, 2, 2, 1, 1],
          rotate: [0, 0, 270, 270, 0],
          borderRadius: ["20%", "20%", "50%", "50%", "20%"],
        }}
      />
    </div>
  );
}
